import './App.css';
import List from './components/list'
import SignIn from './components/signIn'
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (

    <div className="App">
      <BrowserRouter>
          <List/>
        <Routes>

          <Route path="/SignIn" element={<SignIn />} />
        </Routes>

      </BrowserRouter>
    </div>

  );
}

export default App;
